INSERT INTO `kamerat_e_sigurise_umks` (`ID_kamera`, `kamerat_e_sigurise_umks`, `lens_umks`, `id_modelet_umks`, `foto`, `emrifoto`) VALUES
(3, '<h3>Kamera Dome</h3><br><br> është lloji themelor i kamerës së sigurisë, e cila është menduar për instalimin e brendshëm. Emri i kësaj kamere erdhi nga forma e saj e kupolës. Këto kamera përdoren për projekte me kamera vetëm ditore.\r\n<br>\r\n', '<br>\r\n<h3>Lens</h3> <br><br>\r\nKamerat Dome kane nje lens rreth 2.7 deri 13.5mm ', 1, , 'KameraDome.png');
INSERT INTO `kamerat_e_sigurise_umks` (`ID_kamera`, `kamerat_e_sigurise_umks`, `lens_umks`, `id_modelet_umks`, `foto`, `emrifoto`) VALUES
(4, '<h3>Kamera Varifokale</h3> <br><br>\r\njanë krijuar për të lejuar zmadhimin dhe zvogëlimin pa humbur fokusin në imazh. Të përdorura në shumë reality show, këto kamera kanë cilësinë për të nxjerrë në pah personazhet, ashtu siç dëshiron skenari\r\n<br>', '<br>\r\n<h3>Lens</h3> <br><br>\r\nKamera Varifokale kane nje lens rreth 2.8 deri 12mm Lens', 2, , 'KameraVerifokale.png');
INSERT INTO `kamerat_e_sigurise_umks` (`ID_kamera`, `kamerat_e_sigurise_umks`, `lens_umks`, `id_modelet_umks`, `foto`, `emrifoto`) VALUES
(5, '<h3>Kamera Wireless</h3> <br><br>\r\nKëto kamera mund të jenë të lidhura ose jo në internet. Jo të gjitha kamerat wireless janë të bazuara në IP. Disa kamera wireless mund të përdorin mënyra alternative të transmetimit pa tel. Por pa marrë parasysh se cila është metoda e transmetimit , përfitimi \r\nkryesor për këto njësi është akoma i njëjtë: fleksibiliteti ekstrem në instalim.\r\n<br>', '<br>\r\n<h3>Lens</h3> <br><br>\r\nKamerat wireless kane nje lens rreth 5 deri 100mm Lens\r\n\r\n\r\n\r\n\r\n\r\n', 3, , 'KameraWireles.png');
INSERT INTO `kamerat_e_sigurise_umks` (`ID_kamera`, `kamerat_e_sigurise_umks`, `lens_umks`, `id_modelet_umks`, `foto`, `emrifoto`) VALUES
(6, '<h3>Kamerat e tipit të plumb</h3> <br><br>\r\nKëto kamera janë të dizajnuara për të kapur pamjet e një zone specifike, të fiksuara në një vend specifik dhe funksionojnë më mirë si kamera sigurie në shtëpi. Këto kamera janë të hollë dhe cilindrike në dizajn. Ata klasifikohen më tej në Ultra Bullet, zakonisht dallohen nga madhësia e tyre më e vogël dhe çmimi më i lirë.\r\n<br>', '<br>\r\n<h3>Lens</h3> <br><br>\r\nKamerat te tipit plumb kane nje lens rreth 2.8mm deri 15mm\r\n', 4, , 'KameraPlumb.png');

